import React from "react";
import LoadImage from './loadImage';
import CollectionDesc from './CollectionDesc';
import Aux from "react-aux";

let imgClass= { Casablanca: "imgCasablanca", Marocco: "Marocco" };
let name= { Casablanca: "Casablanca", Marocco: "Marocco" };

const collectionRender = (props) => {


  let collectionName = "Casablanca"

  function changCollection()  {
    if (collectionName === "Casablanca") {collectionName = "Marocco"} else {collectionName = "Casablanca"}
    console.log(collectionName)


  }


  return (
    <Aux>
    <LoadImage className={imgClass[collectionName].concat("-1")} link={name[collectionName].concat("-1")} alt="graphics"/>
    <LoadImage className={imgClass[collectionName].concat("-2")} link={name[collectionName].concat("-2")} alt="graphics"/>
    <LoadImage className={imgClass[collectionName].concat("-3")} link={name[collectionName].concat("-3")} alt="graphics"/>
    <CollectionDesc collection={name[collectionName]}/>
    <div className="scroll-info" onClick={changCollection}>
      <h3>go to next collection</h3>
      <div></div>
    </div>
    </Aux>
  );
};

export default collectionRender;
